import React from 'react';
import Button from './components/button';

const App = () => {
  const handleSubmit = () => {
    alert('Button was clicked!');
  };

  return (
    <div>
      <h1>Welcome to My App</h1>
      <Button label="Click Me" onClick={handleSubmit} className="my-button" />
    </div>
  );
};

export default App;
